import './App.css';

import { BrowserRouter as Router, Route, Routes} from "react-route-dom";
import Home from "./Pages/Home";
import Quiz from "./Pages/Quiz";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/quiz" element={Quiz} />
      </Routes>
    </Router>
  );
}


export default App;
